Switch are very similar to whens. Every switch can be translated to a when (but the other way around is not true). In switches, you compare an expression against multiple values. Based on the above when example, we could do the following switch switch (string) { "foo" -> 2 "bar" -> { doSomeStuff() 3 } someString() -> 4
} You'll notice that we couldn't translate the when condition otherCondition(), this is because it isn't a comparison against the switched expression. Each switch branch consists of a value, and a statement. If the provided switch expression matches the branch's expression, the corresponding statement will be executed. Switches also have an else, that is required when returning a primitive int myInt = switch (string) { "foo" -> 2 "bar" -> { doSomeStuff() 3 } someString() -> 4 else -> 5
}

